import React from "react";
import Api from './Api'


function Funcionario(props) {

    let [funcionario, setFuncionario] = useState({nome: '', sobrenome: '', email:'' , numeroNIS: ''});

    Api.loadFuncionario(props.id, (res) => {
        if (res.data) {
            setFuncionario(res.data);
        }
    })

    return <>
        <div width='200px' left='50%'>
            <div>
                <h1>Edição de Funcionário ({props.id})</h1>
            </div>
            <input type='text' name='nome' value={funcionario.nome} size='200' maxLength='200' />
            <br/><br/>
            <input type='text' name='sobrenome' value={funcionario.sobrenome} size='200' maxLength='200' />
            <br/><br/>
            <input type='email' name='email' value={funcionario.email} size='200' maxLength='200' />
            <br/><br/>
            <input type='number' name='numeroNIS' value={funcionario.numeroNIS} size='200' maxLength='200' />
            <br/><br/>
            <input type='button' value='Confirma' onClick={Api.salvaFuncionario} />
            <input type='button' value='Fechar' onClick={Api.fechaCadastro} />
        </div>
    </>
}
